import React, {Component} from "react";
//css
import "../assets/css/Login.css";
import logo from '../assets/images/LOGOPRO.png';


class Login extends Component{

    state={
        form:{
            "usuario": "", 
            "password": ""
        },
        error:false,
        errorMsg:""
    }




    manejadorSubmit = e => {
        e.preventDefault();
    }

    render(){
        return(
               
        <React.Fragment>

                    <div className="wrapper fadeInDown">
                    <div id="formContent">
                    
                        <div className="fadeIn first">
                        
                        <div id="logo">
                        <img src={logo} width="100px"  className="corazon" alt="logotipo" />
                        
                        </div>
                        </div>

                        <form onSubmit={this.manejadorSubmit}>
                        <input type="text"  className="fadeIn second" name="usuario" placeholder="Usuario"/>
                        <input type="password"  className="fadeIn third" name="password" placeholder="Password"/>
                        <input type="submit" className="fadeIn fourth" value="Log In"/>
                        </form>

                        <div id="formFooter">
                        <a className="underlineHover" href="#">Forgot Password?</a>
                        </div>

                    </div>
                    </div>


        </React.Fragment>
        
               
        );
    }

}


export default Login;
